r($,"b1o","aIN",()=>A.a([A.fw("Jaekwang is a leading figure in internet governance and innovative venture ecosystem in Korea. He was a director/audit at NCsoft and Hancom and the general counsel at Naver throughout its foundation and IPO. He was also an advisor at several payment companies such as Inicis, Danal, and Mobilians. He was the head of the Korea Mall Association and the co-chairperson of the e-Korea committee, which supervises the Korean government\u2019s internet policy. As a leader in the area, Bae has made many contributions to establishing Korea\u2019s innovation ecosystem, such as developing listing rules and regulations for establishment of the KOSDAQ market. He has been the president of Korea Fintech Research Institute since 2014. He also founded with Korea National Assembly and is the president at Korea Blockchain, Cryptocurrency, and Innovation Committee, where he is currently legislating Framework Act on Blockchain, cryptocurrency and ICO regulations, etc. He earned his bachelor\u2019s from Seoul National University School of Law and passed the 38th Bar Exam. See Jaekwang Bae\u2019s profile here.",B.al,"","img/team/team01.png","https://www.linkedin.com/in/jae-kwang-bae-5a831416/","Jaekwang Bae","Founder & CEO"),A.fw("Kyoungsoo has over 18 years of experience as a web and mobile service business developer and UI/UX specialist. He joined InstaPay after 10 years of career at SK Communications. Formerly, he co-founded a multimedia education startup with his master\u2019s program advisor and created the first functional game as a content creator and product manager. He earned M.D. in Cognitive Science at Seoul National University.",B.al,"","img/team/team02.png","https://www.linkedin.com/authwall?trk=bf&trkInfo=AQGdETxcqWgo1AAAAYIPxS6IExfZdLI9LPHJ0H4hwdVM0-5Oxe2hi6EGoSSG7vn7RNKLYgBPVPmXQZhmjWxlRU-qGae7_LXKSb7CwySS4Lj0HbOLPCXtVk8w8GKTc-AlPwKp3ME=&original_referer=&sessionRedirect=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fkyoung-soo-kim-a4a07ba7","Kyoungsoo Kim","CPO"),A.fw("Kwang Yeon oversees digital contents and media platform. He specializes in development of synthetical contents by coordinating analytical approach and qualitative knowledge. He is the founder of Wikidok, which provides wiki platform service. Previously, Won worked for NCsoft and Naver\u2019s search management support team and knowledge encyclopedia team. He earned Bachelor\u2019s degree in journalism and Master\u2019s degree in political science at Seoul National University.",B.al,"","img/team/team03.png","","Kwangyeon Won","CCO"),A.fw("Business strategy and communications specialist with extensive experience in media, various platforms, and IR, Jongsung was COO at Sinjisoft, the company that developed the world\u2019s first VM(Virtual Machine). He was in charge of the business plan and design of mobile platform and related business. He also played a major role in expanding the Digital Multimedia Broadcasting(DMB) business, which became a major hit in Korea in early 2000\u2019s. Later he supported several major electronics, distributor, and automobile companies in Korea expand their business by working with many investors as a IR specialist. He will help InstaPay market its business effectively by expanding its user base and various networks in the market. He studied Organization Communication at Hanyang University.",B.al,"","img/team/team04.png","https://www.linkedin.com/authwall?trk=bf&trkInfo=AQGRWLXN9gsTtAAAAYIPy0UgmP3rah7BEzro8m6CC4UCyDzngJjxlYlV5UiD6dvevHvHF20BRref5Pw-1LldJn180mD5HPtRw9b_muO4ODSmAFl6xrZynWZ80eSLXrGWdLEsBQ0=&original_referer=&sessionRedirect=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fcjs1006","Jongsung Chun","Media & Platform Director"),A.fw("Sangyeop specializes in InfoSec and Architecture. In the past years, he worked for financial companies including KEB Hana Bank. He contributed to the development of Crypto-Market and led architecture and implementation of InstaPay\u2019s server, including integration of Payment-gateway with KFTC. He majored in Computer Science at Pusan National University.",B.al,"","img/team/team05.png","https://www.linkedin.com/authwall?trk=gf&trkInfo=AQEGUEN7DxlTggAAAYIPy8nwxu_36zhK_1rrZFzt7XCmF4avXwwP9KhTqvKEPcznjdAsTtxNxvSlwdNoFu124ICCw8nFbGsSvo4Xzjzt7IWZ9HB0gvbDF6M05dY744s61Fp50vQ=&original_referer=https://www.instacoins.io/&sessionRedirect=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fyuki-kim-49648b169%2F","Sangyeop Kim","Chief Blockchain Architect"),A.fw("Keunhye has 15 years\u2019 experience in advertising and marketing communication. After graduation, Lee joined Daehong Communications, an advertising marketing agency, as an ad creator. Lee participated in many big campaigns in IMC dimension, with specialization in advertising and promotion. Lee majored in industrial design and business administration at Seoul National University.",B.al,"","img/team/team06.png","https://www.linkedin.com/authwall?trk=gf&trkInfo=AQFBifbiFV9EOAAAAYIPzFp4CO40Y3dJfcshgByL4Z1GpAFk-ulPbXI4G9VRMWRoAPQOY3HEkxR6ngaJ9Ji-ujzjf7Zy4pnucxK4YaeysvwThN4DsNtxpMYHq8hW_YMQqNQthhU=&original_referer=https://www.instacoins.io/&sessionRedirect=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fkeun-hye-lee-b3a666112%2F","Keunhye Lee","Director of Marketing and Communication"),A.fw("Yewon is a graphic designer with a demonstrated history of working in the design industry. Skilled in Adobe Creative Suite and Typography. Strong professional with a Master\u2019s Degree focused in Graphic Design from Seoul National University and a Bachelor\u2019s Degree from Rhode Island School of Design.",B.al,"","img/team/team07.png","","Yewon Yoo","UX and Visual Designer"),A.fw("We are looking for talented, driven people to join our journey of bringing the crypto-payment innovation to reality. If you\u2019re interested or have any inquiry, please contact us at business@instapay.kr",B.al,"","","","You?","")],t.rl))
